function lion(){
    var synth=window.speechSynthesis;
    speak_data="LION";
    var utterThis=new SpeechSynthesisUtterance(speak_data);
    synth.speak(utterThis);
    document.getElementById("resultlion").innerHTML='<img id="lion" src="data:image/png;base64,">';
}
